import { useEffect, useState } from 'react';
import { Link } from 'react-scroll';
import { BrowserRouter as Router } from 'react-router-dom';
import { motion, useScroll, useTransform } from 'framer-motion';
import './App.css';

function App() {
  const [scrollY, setScrollY] = useState(0);
  const { scrollYProgress } = useScroll();

  // Parallax and fade animations
  const opacity = useTransform(scrollYProgress, [0, 0.5, 1], [1, 0.5, 0]);
  const scale = useTransform(scrollYProgress, [0, 0.5, 1], [1, 0.95, 0.9]);

  useEffect(() => {
    const handleScroll = () => {
      setScrollY(window.scrollY);
    };
    window.addEventListener('scroll', handleScroll);
    return () => window.removeEventListener('scroll', handleScroll);
  }, []);

  // Animation variants for sections
  const fadeInUp = {
    initial: { opacity: 0, y: 60 },
    animate: { opacity: 1, y: 0 },
    transition: { duration: 0.6, ease: "easeOut" }
  };

  const staggerContainer = {
    initial: {},
    animate: {
      transition: {
        staggerChildren: 0.1
      }
    }
  };

  return (
    <Router>
      <div className="App">
        <nav className="navbar">
          <ul>
            {['intro', 'experience', 'projects', 'skills', 'education'].map((section) => (
              <motion.li
                key={section}
                whileHover={{ scale: 1.1 }}
                whileTap={{ scale: 0.95 }}
              >
                <Link
                  to={section}
                  spy={true}
                  smooth={true}
                  offset={-70}
                  duration={800}
                  className="nav-link"
                >
                  {section.charAt(0).toUpperCase() + section.slice(1)}
                </Link>
              </motion.li>
            ))}
          </ul>
        </nav>

        <motion.section 
          id="intro" 
          className="section intro-section"
        >
          <div className="greeting">
            <motion.h2
              initial={{ opacity: 0, scale: 0.5 }}
              animate={{ 
                opacity: 1, 
                scale: [0.5, 10.5, 1]
              }}
              transition={{ 
                duration: 2.8,
                scale: {
                  times: [0, 5.5, 10],
                  type: "spring",
                  damping: 8,
                  stiffness: 100
                }
              }}
            >
              Hey there! 👋
            </motion.h2>
          </div>

          <motion.div 
            className="profile-content"
            initial={{ opacity: 0, y: 100 }}
            animate={{ opacity: 1, y: 0 }}
            transition={{ duration: 0.8 }}
          >
            <motion.div 
              className="profile-image-container"
              whileHover={{ scale: 1.05 }}
              transition={{ type: "spring", stiffness: 300 }}
            >
              <img 
                src={process.env.PUBLIC_URL + '/profile-picture.jpeg'} 
                alt="Prarthana Prathap" 
                className="profile-image"
              />
            </motion.div>
            <motion.h1 
              className="name"
              initial={{ opacity: 0, x: -100 }}
              animate={{ opacity: 1, x: 0 }}
              transition={{ delay: 0.2 }}
            >
              Prarthana Prathap
            </motion.h1>
            <motion.p 
              className="tagline"
              initial={{ opacity: 0, x: 100 }}
              animate={{ opacity: 1, x: 0 }}
              transition={{ delay: 0.4 }}
            >
              Full Stack Developer & Tech Enthusiast
            </motion.p>
            <motion.div 
              className="social-links"
              variants={staggerContainer}
              initial="initial"
              animate="animate"
            >
              <motion.a 
                href="https://github.com/Prarthana-Prathap" 
                target="_blank" 
                rel="noopener noreferrer"
                whileHover={{ scale: 1.1 }}
                whileTap={{ scale: 0.95 }}
              >
                GitHub
              </motion.a>
              <motion.a 
                href="https://www.linkedin.com/in/prarthanaprathap/" 
                target="_blank" 
                rel="noopener noreferrer"
                whileHover={{ scale: 1.1 }}
                whileTap={{ scale: 0.95 }}
              >
                LinkedIn
              </motion.a>
            </motion.div>
          </motion.div>
        </motion.section>

        <motion.section 
          id="experience" 
          className="section"
          {...fadeInUp}
        >
          <motion.h2 initial={{ opacity: 0 }} whileInView={{ opacity: 1 }}>Experience</motion.h2>
          <motion.div 
            className="experience-container"
            variants={staggerContainer}
            initial="initial"
            whileInView="animate"
          >
            <motion.div 
              className="experience-item"
              variants={fadeInUp}
              whileHover={{ scale: 1.02 }}
            >
              <h3>Software Engineer</h3>
              <p className="company">Company Name</p>
              <p className="duration">2023 - Present</p>
              <ul className="responsibilities">
                <li>Key responsibility 1</li>
                <li>Key responsibility 2</li>
                <li>Key responsibility 3</li>
              </ul>
            </motion.div>
          </motion.div>
        </motion.section>

        <motion.section 
          id="projects" 
          className="section"
          {...fadeInUp}
        >
          <motion.h2 initial={{ opacity: 0 }} whileInView={{ opacity: 1 }}>Projects</motion.h2>
          <motion.div 
            className="projects-grid"
            variants={staggerContainer}
            initial="initial"
            whileInView="animate"
          >
            <motion.div 
              className="project-card"
              variants={fadeInUp}
              whileHover={{ 
                scale: 1.05,
                boxShadow: "0px 8px 30px rgba(0, 0, 0, 0.1)"
              }}
            >
              <h3>Project Name</h3>
              <p>Project description goes here</p>
              <div className="tech-stack">
                <motion.span whileHover={{ scale: 1.1 }}>React</motion.span>
                <motion.span whileHover={{ scale: 1.1 }}>Node.js</motion.span>
                <motion.span whileHover={{ scale: 1.1 }}>MongoDB</motion.span>
              </div>
              <div className="project-links">
                <motion.a 
                  href="#" 
                  target="_blank" 
                  rel="noopener noreferrer"
                  whileHover={{ scale: 1.1 }}
                  whileTap={{ scale: 0.95 }}
                >
                  Live Demo
                </motion.a>
                <motion.a 
                  href="#" 
                  target="_blank" 
                  rel="noopener noreferrer"
                  whileHover={{ scale: 1.1 }}
                  whileTap={{ scale: 0.95 }}
                >
                  GitHub
                </motion.a>
              </div>
            </motion.div>
          </motion.div>
        </motion.section>

        <motion.section 
          id="skills" 
          className="section"
          {...fadeInUp}
        >
          <motion.h2 
            initial={{ opacity: 0 }} 
            whileInView={{ opacity: 1 }}
            className="section-title"
          >
            Skills
          </motion.h2>
          <motion.div 
            className="skills-container"
            variants={staggerContainer}
            initial="initial"
            whileInView="animate"
          >
            {[
              {
                category: 'Frontend',
                skills: [
                  { name: "React", level: 90 },
                  { name: "JavaScript", level: 85 },
                  { name: "HTML/CSS", level: 95 }
                ]
              },
              {
                category: 'Backend',
                skills: [
                  { name: "Node.js", level: 80 },
                  { name: "Python", level: 85 },
                  { name: "SQL", level: 75 }
                ]
              }
            ].map((category, categoryIndex) => (
              <motion.div 
                key={category.category}
                className="skill-category"
                variants={fadeInUp}
                custom={categoryIndex}
                whileHover={{ scale: 1.02 }}
              >
                <h3>{category.category}</h3>
                <div className="skills-grid">
                  {category.skills.map((skill, skillIndex) => (
                    <motion.div 
                      key={skill.name}
                      className="skill-item"
                      initial={{ opacity: 0, x: -20 }}
                      whileInView={{ opacity: 1, x: 0 }}
                      transition={{ 
                        duration: 0.5,
                        delay: skillIndex * 0.1
                      }}
                      viewport={{ once: true }}
                      whileHover={{ scale: 1.02 }}
                    >
                      <div className="skill-info">
                        <span className="skill-name">{skill.name}</span>
                        <motion.span 
                          className="skill-percentage"
                          initial={{ opacity: 0 }}
                          whileHover={{ opacity: 1 }}
                        >
                          {skill.level}%
                        </motion.span>
                      </div>
                      <div className="skill-bar-bg">
                        <motion.div 
                          className="skill-bar"
                          initial={{ width: "0%" }}
                          whileInView={{ width: `${skill.level}%` }}
                          transition={{ 
                            duration: 1.2,
                            delay: skillIndex * 0.2,
                            ease: "easeOut"
                          }}
                          viewport={{ once: true }}
                        >
                          <span className="skill-bar-percentage">{skill.level}%</span>
                        </motion.div>
                      </div>
                    </motion.div>
                  ))}
                </div>
              </motion.div>
            ))}
          </motion.div>
        </motion.section>

        <motion.section 
          id="education" 
          className="section"
          {...fadeInUp}
        >
          <motion.h2 initial={{ opacity: 0 }} whileInView={{ opacity: 1 }}>Education</motion.h2>
          <motion.div 
            className="education-container"
            variants={staggerContainer}
            initial="initial"
            whileInView="animate"
          >
            <motion.div 
              className="education-item"
              variants={fadeInUp}
              whileHover={{ scale: 1.02 }}
            >
              <h3>Degree Name</h3>
              <p className="institution">University Name</p>
              <p className="duration">2019 - 2023</p>
              <p className="gpa">GPA: X.XX</p>
            </motion.div>
          </motion.div>
        </motion.section>
      </div>
    </Router>
  );
}

export default App;
